import {createRouter,createWebHistory} from 'vue-router'
import foo from './views/foo.vue'
const routes = [
    {
        path : '/',
        component : foo
    },
]
const history  = createWebHistory(process.env.BASE_URL);

const router = createRouter({
    history,
    routes
})

export default router
